import React, { FC, useState } from "react";
import NoNavLayout from "../../components/Layouts/NoNavLayout";
import { useKeyboardForm } from "../../lib/keyboardFormStore";
import { Flex, Sans } from "@rsbear/betsy";
import StepOne from "../../components/KeyboardFormSteps/StepOne";

const CreateKeyboard: FC<any> = () => {
  const [steps, setSteps] = useState({ one: true, two: false, three: false });
  const { values, changeStringInArray, setString } = useKeyboardForm();

  async function onSubmit() {
    event?.preventDefault();
    console.log("values", values);
  }

  function setStepOneComplete() {
    setSteps((prev) => {
      return { ...prev, one: true, two: true, three: false };
    });
  }

  return (
    <NoNavLayout>
      <Sans fontSize="42px" fontWeight={600}>
        Create Keyboard
      </Sans>
      <Flex>
        <div>part one --- </div>
        <div>part two --- </div>
        <div>part three</div>
      </Flex>
      <form onSubmit={onSubmit}>
        <StepOne steps={steps} setStepOneComplete={setStepOneComplete} />

        <p>extra plates</p>

        <input
          type="text"
          placeholder="colors"
          value={values.colors[0]}
          name="colors"
          tabIndex={0}
          onChange={(e) => changeStringInArray(e)}
        />
        <button type="submit">submit</button>
      </form>
    </NoNavLayout>
  );
};

export default CreateKeyboard;
